(3, 6, 'Tahe Marine Lifestyle 420', 'Stabil, lättmanövrerad mycket prisvärd kajak som passar utmärkt att ha till att paddla kortare turer i. Kajaken är relativt kort och bred vilket gör den mycket stabil och trygg så även helt nybörjare kan känna sig trygga. En perfekt \"sommarstuge kajak\" för hela familjen. Utan roder.', 1, 29),
(4, 6, 'Seabird Expedition Odin', 'Fantastisk förstagångskajak för barn och ungdomar samt för vuxna upp till 50 kg och 160 cm. Kajaken är smal framtill vilket gör att man kan sätta in paddeln nära kroppen. Den är utrustad med roder och har en längd på 367 cm.', 1, 14),
(9, 6, 'Seabird Expedition Odin', 'Fantastisk förstagångskajak för barn och ungdomar samt för vuxna upp till 50 kg och 160 cm. Kajaken är smal framtill vilket gör att man kan sätta in paddeln nära kroppen. Den är utrustad med roder och har en längd på 367 cm.', 1, 27),
(10, 6, 'Tahe Marine Lifestyle 420', 'Stabil, lättmanövrerad mycket prisvärd kajak som passar utmärkt att ha till att paddla kortare turer i. Kajaken är relativt kort och bred vilket gör den mycket stabil och trygg så även helt nybörjare kan känna sig trygga. En perfekt \"sommarstuge kajak\" för hela familjen. Utan roder.', 1, 30),
(11, 8, 'Inkas 465L', 'En lätt och smidig kanot för insjöar och åar. Lätt att lasta på biltak. Osänkbar. 3 års garanti. Godkänt av Det Norske Veritas. Lämplig för privat bruk. Lättmanövrerad och perfekt även för en person (kan med bärok lätt bäras av en person).', 1, 34),
(12, 8, 'Inkas 465L', 'En lätt och smidig kanot för insjöar och åar. Lätt att lasta på biltak. Osänkbar. 3 års garanti. Godkänt av Det Norske Veritas. Lämplig för privat bruk. Lättmanövrerad och perfekt även för en person (kan med bärok lätt bäras av en person).', 0, 35),
(13, 8, 'Inkas 465L', 'En lätt och smidig kanot för insjöar och åar. Lätt att lasta på biltak. Osänkbar. 3 års garanti. Godkänt av Det Norske Veritas. Lämplig för privat bruk. Lättmanövrerad och perfekt även för en person (kan med bärok lätt bäras av en person).', 0, 36),
(14, 8, 'Inkas 465L', 'En lätt och smidig kanot för insjöar och åar. Lätt att lasta på biltak. Osänkbar. 3 års garanti. Godkänt av Det Norske Veritas. Lämplig för privat bruk. Lättmanövrerad och perfekt även för en person (kan med bärok lätt bäras av en person).', 0, 37),
(15, 8, 'Inkas 465L', 'En lätt och smidig kanot för insjöar och åar. Lätt att lasta på biltak. Osänkbar. 3 års garanti. Godkänt av Det Norske Veritas. Lämplig för privat bruk. Lättmanövrerad och perfekt även för en person (kan med bärok lätt bäras av en person).', 0, 38),
(16, 6, 'Tahe Marine Coastspirit', 'The CoastSpirit kayak is from the Spirit series the most advanced one. The kayak is with slightly swedeformed hull with hard chine and a round bottom, which definitely makes it not only the fastest PE kayak in the Tahe Marine range, but even one of the fastest PE kayak on the market. The kayak is good for general touring, day tripping, but also due to the good maneuverability of the hull, it can take also rougher conditions on open sea. The Spirit series is the perfect choice for those, who appreciate a quality product that comes at an affordable price. The Spirit series kayaks come with either a skeg or rudder/skeg combination.\r\nThe Spirit series are our go-to boats for the paddler who doesn´t have an armada to choose from. There is always a trade-off between handling, speed, and stability; our designers had balance in mind for these kayaks. The balance changes with the skill level of the paddler. Keeping this in mind, our designers came up with four progressively advanced kayaks.\r\n\r\nWEIGHT:\r\nPE: 26-28 kg (57-62 lbs)\r\n\r\nSTORAGE:\r\nFront: round hatch 24 cm (10”)\r\nRear: oval hatch 44x26 cm (17”x10¼”)\r\n\r\nRetractable skeg\r\nRetractable skeg + rudder', 0, 39),
(17, 6, 'Tahe Marine Coastspirit', 'The CoastSpirit kayak is from the Spirit series the most advanced one. The kayak is with slightly swedeformed hull with hard chine and a round bottom, which definitely makes it not only the fastest PE kayak in the Tahe Marine range, but even one of the fastest PE kayak on the market. The kayak is good for general touring, day tripping, but also due to the good maneuverability of the hull, it can take also rougher conditions on open sea. The Spirit series is the perfect choice for those, who appreciate a quality product that comes at an affordable price. The Spirit series kayaks come with either a skeg or rudder/skeg combination.\r\nThe Spirit series are our go-to boats for the paddler who doesn´t have an armada to choose from. There is always a trade-off between handling, speed, and stability; our designers had balance in mind for these kayaks. The balance changes with the skill level of the paddler. Keeping this in mind, our designers came up with four progressively advanced kayaks.\r\n\r\nWEIGHT:\r\nPE: 26-28 kg (57-62 lbs)\r\n\r\nSTORAGE:\r\nFront: round hatch 24 cm (10”)\r\nRear: oval hatch 44x26 cm (17”x10¼”)\r\n\r\nRetractable skeg\r\nRetractable skeg + rudder', 1, 40),
(18, 6, 'Tahe Marine Reval mini', 'The Reval Mini LC PE is a PE version of  Reval Mini LC composite kayak. Reval Mini LC is a British style kayak with a slightly more volume. It has a superb stability and performance in all sea conditions. \r\n\r\nReval Mini LC PE is a responsive kayak that is really easy to turn. LC is perfect for medium sized paddler, who want to enjoy a roomier cockpit area. The LC PE cockpit with thigh braces provides an easier entry and good support. The hull is designed with rocker and upswept bow and stern. The initial stability of the Reval Mini LC PE is a little higher providing a secure feeling. Reval Mini LC PE sea touring kayak is for paddlers who are looking for a nice British style kayak that can handle more challenging sea conditions. The Reval series kayaks are equipped with retractable skeg or retractable skeg/rudder option.', 1, 41),
(19, 6, 'Tahe Marine Reval mini', 'The Reval Mini LC PE is a PE version of  Reval Mini LC composite kayak. Reval Mini LC is a British style kayak with a slightly more volume. It has a superb stability and performance in all sea conditions. \r\n\r\nReval Mini LC PE is a responsive kayak that is really easy to turn. LC is perfect for medium sized paddler, who want to enjoy a roomier cockpit area. The LC PE cockpit with thigh braces provides an easier entry and good support. The hull is designed with rocker and upswept bow and stern. The initial stability of the Reval Mini LC PE is a little higher providing a secure feeling. Reval Mini LC PE sea touring kayak is for paddlers who are looking for a nice British style kayak that can handle more challenging sea conditions. The Reval series kayaks are equipped with retractable skeg or retractable skeg/rudder option.', 0, 42),
(20, 6, 'Tahe Marine Lifestyle solo', 'Solo is a stable day-touring kayak made for smaller size paddlers and for beginners.\r\n\r\nLifestyle Solo is extremely stable with an oversized cockpit that provides easy entry and exit. Lifestyle Solo has an exceptional handling, but also a surprising amount of speed to keep things fun. Lifestyle Solo is equipped with two round hatches for easier packing and access to your equipment.\r\n\r\nIn standard Lifestyle Solo has no rudder installed and can be easily paddled with out one, but optionally the complete rudder set can be installed.', 1, 43),
(21, 6, 'Tahe Marine Lifestyle solo', 'Solo is a stable day-touring kayak made for smaller size paddlers and for beginners.\r\n\r\nLifestyle Solo is extremely stable with an oversized cockpit that provides easy entry and exit. Lifestyle Solo has an exceptional handling, but also a surprising amount of speed to keep things fun. Lifestyle Solo is equipped with two round hatches for easier packing and access to your equipment.\r\n\r\nIn standard Lifestyle Solo has no rudder installed and can be easily paddled with out one, but optionally the complete rudder set can be installed.', 0, 44),
(22, 8, 'Inkas 465L', 'En lätt och smidig kanot för insjöar och åar. Lätt att lasta på biltak. Osänkbar. 3 års garanti. Godkänt av Det Norske Veritas. Lämplig för privat bruk. Lättmanövrerad och perfekt även för en person (kan med bärok lätt bäras av en person).', 1, 45),
(23, 2, 'Härsjönäs', '', 1, 46);
